class TrieNode:
	def __init__(self):
		self.children = [None] * 26
		self.isEndOfWord = False
M = 5
N = 5
class Boogle:
	def __init__(self):
		self.root = self.getNode()
	def getNode(self):
		return TrieNode()
	def _charToIndex(self, ch):
		return ord(ch) - ord('A')
	def insert(self, key):
		pCrawl = self.root
		length = len(key)
		for level in range(length):
			index = self._charToIndex(key[level])
			if not pCrawl.children[index]:
				pCrawl.children[index] = self.getNode()
			pCrawl = pCrawl.children[index]
		pCrawl.isEndOfWord = True

def is_Safe(i, j, vis):
	return 0 <= i < M and 0 <= j < N and not vis[i][j]

def search_word(root, boggle, i, j, vis, string):
	if root.isEndOfWord:
		iswordin[dictionary2[string]]=1
		#print(string)
	if is_Safe(i, j, vis):
		vis[i][j] = True
		for K in range(26):
			if root.children[K] is not None:
				ch = chr(K+ord('A'))
				if is_Safe(i + 1, j + 1, vis) and boggle[i + 1][j + 1] == ch:
					search_word(root.children[K], boggle,i + 1, j + 1, vis, string + ch)
				if is_Safe(i, j + 1, vis) and boggle[i][j + 1] == ch:
					search_word(root.children[K], boggle,i, j + 1, vis, string + ch)
				if is_Safe(i - 1, j + 1, vis) and boggle[i - 1][j + 1] == ch:
					search_word(root.children[K], boggle,i - 1, j + 1, vis, string + ch)
				if is_Safe(i + 1, j, vis) and boggle[i + 1][j] == ch:
					search_word(root.children[K], boggle,i + 1, j, vis, string + ch)
				if is_Safe(i + 1, j - 1, vis) and boggle[i + 1][j - 1] == ch:
					search_word(root.children[K], boggle,i + 1, j - 1, vis, string + ch)
				if is_Safe(i, j - 1, vis) and boggle[i][j - 1] == ch:
					search_word(root.children[K], boggle,i, j - 1, vis, string + ch)
				if is_Safe(i - 1, j - 1, vis) and boggle[i - 1][j - 1] == ch:
					search_word(root.children[K], boggle,i - 1, j - 1, vis, string + ch)
				if is_Safe(i - 1, j, vis) and boggle[i - 1][j] == ch:
					search_word(root.children[K], boggle,i - 1, j, vis, string + ch)
				vis[i][j] = False

def char_int(ch):
	return ord(ch) - ord('A')

